  `_payPassword` int NOT NULL DEFAULT '123456' COMMENT '支付密码',
  PRIMARY KEY (`id`),
  UNIQUE KEY `phone_UNIQUE` (`phone`),
  KEY `index_phone` (`phone`),
  KEY `index_phone_password` (`phone`,`_password`)
) ENGINE=InnoDB AUTO_INCREMENT=1760957151428 DEFAULT CHARSET=utf8mb3 COMMENT='用户隐私信息表。\n对安全要求高，不想泄漏真实名称。对外名称为 Privacy';
